import { Home, Activity } from 'react-feather'
export default [
  {
    id: 'tools',
    title: 'Tools',
    icon: <Home />,
    children: [
      {
        id: 'eCommerceDash',
        title: 'Network',
        icon: <Activity />,
        navLink: '/dashboard/ecommerce'
      },
      {
        id: 'analyticsDash',
        title: 'Development',
        icon: <Activity />,
        navLink: '/dashboard/analytics'
      }
    ]
  }
]
